import {Link} from 'react-router-dom';
import { Slot} from '@croct/plug-react';
function marketer(){
  croct.user.edit().custom('persona', 'developer').save();
    return (
      <div>
         <Slot id="home-banner">
       {({title, subtitle, cta}: HomeBannerContent)  => (
      <div>
        <strong>{title}</strong>
        <p>{subtitle}</p>
        <a href={cta.link}>{cta.label}</a>
      </div>
       )}
    </Slot>
        <Link to="/">
        <button>Voltar</button></Link>
        </div>
    )
    
  }
export default marketer;
